import React from 'react';
import { Link } from 'react-router-dom'
import {Toggle} from "react-toggle-component"

export const ChartEntry = (props) => {
  const { chartEntries } = props;
  let check = [chartEntries.myAP];
  console.log(check);
  if (chartEntries !== undefined) {
    return (
        <div>
          { chartEntries.myAP && chartEntries.myAP.map((entry, index) => {
            return (
              <label>
                    <p>{entry.AP_name}</p>
                    <Toggle name={entry.AP_name} onToggle={e => console.log('onToggle', e.target.checked)} />
                </label>
            )
          }) }
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
